'''Jerico''' is a pigeon enthusiast living between the chapel and the northern bank of [[East Ardougne]]. He owns several [[pigeon]]s, which he uses to communicate with the quarantined [[West Ardougne]].{{CiteNPC |npc=Jerico |quote=My messenger pigeons help me communicate with friends over the wall. |loc=Biohazard }} If the player chooses to, he will eagerly engage them in conversation about pigeons. 

He has several friends in Ardougne, such as [[Edmond]],{{CiteNPC |npc=Elena |quote=My father's friend Jerico is in communication with West Ardougne. |loc=Biohazard }} [[Omart]] and [[Kilron]].{{CiteNPC |npc=Jerico |quote=I have arranged for two friends to aid you with a rope ladder. Omart is waiting for you at the south end of the wall. |loc=Biohazard }} When [[Elena]] wanted to [[Biohazard|study the plague]], he helped the adventurer who [[Plague City|rescued her]] to sneak over the wall in order to retrieve her [[distillator]], which had been stolen by the [[mourner]]s. He distracted the mourners watching the gate by [[Pigeon cage|releasing]] several of his pigeons, allowing the adventurer to climb over and into the quarantined city.

A [[Clue scroll (medium)|medium clue scroll]] asks how many pigeons he has around his house. The answer is three.

==Trivia==
According to [[Postbag from the Hedge]] issue 8, his family have been raising messenger pigeons for years, and Jerico claims they have even been used in wartime.{{CitePostbag|issue=8|letter=Letter 6|author=Jerico}}

